import logo from './logo.svg';

import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.min.js";

import './App.css';

function App() {

  const user = {
    firstName: "Erubiel",
    lastName: "Huerta",
    bio: "bio",
    email: "eru@gmail.com",
    authenticed:true,
  };

  if (user.authenticated()) {
    return (
      <div>
        <h1>Welcome to our new app</h1>
        <h6>{user.firstName}</h6>
        <img src={user.image} />
      </div>
    )
  } else {
    <div>
      <h1>Please Login</h1>
    </div>
  }

}

export default App;
